def check_correct(exchange_rate, isNone):
    copy = [[r for r in row] for row in exchange_rate]
    conversions = make_money(copy)
    if isNone:
        return conversions is None
    if (conversions is None or 
            len(conversions) == 0 or 
            conversions[0] != 0 or 
            conversions[-1] != 0):
        return False

    exchange = 1
    for i in range(len(conversions) - 1):
        exchange *= exchange_rate[conversions[i]][conversions[i + 1]]
    return exchange > 1

class TestCurrencyTrans(unittest.TestCase):
    def test_01(self):
        self.assertTrue(check_correct(tests[0], test_answers_is_none[0]))

    def test_02(self):
        self.assertTrue(check_correct(tests[1], test_answers_is_none[1]))

    def test_03(self):
        self.assertTrue(check_correct(tests[2], test_answers_is_none[2]))

    def test_04(self):
        self.assertTrue(check_correct(tests[3], test_answers_is_none[3]))
       
    def test_05(self):
        self.assertTrue(check_correct(tests[4], test_answers_is_none[4]))

